import React, { useState } from 'react';
import { View, Button, Text } from 'react-native';

export default function Test() {
    const [startButton, setStartButton] = useState(false);
    const [callButton, setCallButton] = useState(true);
    const [hangupButton, setHangupButton] = useState(true);
    const [stopButton, setStopButton] = useState(true);

    const startLocalVideo = () => {
        // enable call and stop (local video) buttons
        // disable start button
        setStartButton(true)
        setCallButton(false)
        setStopButton(false)
    };

    const connectRemoveVideo = () => {
        // enable hangup button
        // disable call button
        console.log("connect remote video")
    };

    // const stopRemoteVideo = () => {

    // };

    // const stopLocalVideo = () => {

    // };

    return(
        <View>
            <View class="buttons">
                <Button title="start" disabled={startButton} onPress={startLocalVideo} />
                <Button title="call" disabled={callButton} onPress={connectRemoveVideo}/>
                <Button title="hang up" disabled={hangupButton} />
                <Button title="stop" disabled={stopButton} />
            </View>
        </View>
    );
}
